notes:
- Uses OAuth2 with refresh token — requires setup of connected app in api
- An open-source toolkit for optimizing and deploying deep learning models.
- Boost your AI deep-learning inference performance!
- Requires OAuth2 for authentication
- Rate limits are enforced on API calls
- OpenVINO 2025.2 is not a Long-Term-Support version.
- Currently supported versions are 2025.2 (development) and 2024.6 (maintenance).
- Requires OAuth2 authentication for API access.
- Rate limits are in place for API usage.
- System configurations used for Intel® Distribution of OpenVINO™ toolkit performance
  results are based on release 2025.2, as of June 18th, 2025.
- OpenVINO Model Server performance results are based on release 2025.2, as of July
  3, 2025.
- Some objects like Contact may return nulls in deeply nested fields
- Requires setup of API key for access
- Some features may have usage limits
- Requires setup of OAuth2 for access
- Some endpoints may have rate limits
errors:
- 'REQUEST_LIMIT_EXCEEDED: Throttle API calls or reduce frequency'
- 'QUERY_TIMEOUT: Break down filters or add selectivity'
- '401 Unauthorized: Recheck OAuth scopes or token expiration'
- '429 Too Many Requests: Reduce the frequency of API calls'
- '500 Internal Server Error: Retry the request after a short delay'
- '400 Bad Request: Check parameters sent in the request.'
- '401 Unauthorized: Ensure valid authentication credentials.'
- '429 Too Many Requests: Rate limit exceeded.'
- 'INVALID_REQUEST: Check request parameters'
- 'UNAUTHORIZED: Ensure API key is valid'
- 'FORBIDDEN: Access to this resource is denied'
- '401 Unauthorized: Check client credentials'
- '429 Too Many Requests: Rate limit exceeded'
auth_info:
  mentioned_objects:
  - OauthToken
  - AuthProvider
  - NamedCredential
client:
  base_url: https://api.openvino.com
  auth:
    type: oauth2
    flow: refresh_token
    token_url: https://auth.openvino.com/token
    client_id: '{{ dlt.secrets[''openvino_client_id''] }}'
    client_secret: '{{ dlt.secrets[''openvino_client_secret''] }}'
    refresh_token: '{{ dlt.secrets[''openvino_refresh_token''] }}'
    location: header
    header_name: Authorization
